import Topmenu from './Topmenu';
import Topbenner from './Topbenner';
import College from './College';
import Collegelist from './Collegelist';
import Data from './Data';
const App=()=>
  {
   const collegeData=Data.map((key)=><College clgname={key.collegeData} clgcourse={key.course} clgfees={key.fees} clgabout={key.about} />)
    return(
       <>
       <h1>Welcome to Bhopal Educational Institute!!</h1>
       <div className="row">
         {collegeData}
        </div>
        <Topmenu />
  <Topbenner />
  <College />
  <Collegelist />
  <Data />
       </>
    );
  }

 export default App;
